import React from 'react';
import logo from './logo.svg';
import './App.css';


import Header from './Header';


function App() {
  return (
    <div>
      <Header />
      <div className="home-content">
        <div className="banner-sec">
          <div className="banner-img">
            <img src={process.env.PUBLIC_URL + "/images/banner.jpg"} alt="banner" width="100%" />
          </div>
          <div className="banner-cont">
          <div className="container flexible">
            <div className="div1">
            <img src={process.env.PUBLIC_URL + "/images/send.png"} alt="banner" width="100%" />
            </div>
            <div className="div2">
              <h1>GIFTS<br></br> FOR EVERYONE</h1>
            </div>
            <div className="div3">
            <img src={process.env.PUBLIC_URL + "/images/redeem.png"} alt="banner" width="100%" />
            </div>
          </div>
          </div>
        </div>
      </div>
   </div>

  );
}

export default App;
